window.bookSummaryJSON = "<p>Santiago Alatorre</p> <p>One mistake destroys my career. I go from most eligible bachelor to monster, hiding from the world. At least until Chloe breaks into my home.</p> <p>My new fake girlfriend is a temporary fix to my biggest problem. But as our game changes, so do my feelings. There's only one issue stopping me from claiming her. Me.</p> <p>Chloe Carter</p> <p>It all started with a birthday wish, some vodka, and an ancestry kit. That's how I end up in Italy, finding my long-lost father. But one decision lands me a fake boyfriend I don't want.</p> <p>The more we pretend, the easier our ruse becomes. I told myself not to fall in love with a liar like Santiago. I should have listened.</p> <p>Contains mature themes.</p>"; 
